INSERT INTO `post` VALUES (12,'admin','2019-04-08 02:21:40','<p>Некий текст в короткой новости.</p>\r\n<p><img src=\"../static/uploads/posts/12/logo.png\" alt=\"Image\" width=\"191\" height=\"218\">&nbsp;</p>\r\n<p>&nbsp;</p>','<div style=\"0word-spacing: 1.1px;\">\r\n<p><img src=\"../static/uploads/posts/12/2222.png\" alt=\"Image\" width=\"261\" height=\"170\"></p>\r\n<p>&nbsp;</p>\r\n<div class=\"\\&quot;quote_block\">\r\n<div class=\"\\&quot;quote\\&quot;\">\r\n<div class=\"\\&quot;quote_body\"><em><strong><span style=\"0color: #e03e2d; font-size: 12pt;\">Таблица приблизительных отверстий в дюзе ( штуцер ) для газовых форсунок - VALTEK 3om type 30.</span></strong></em> <br><em><strong><span style=\"0color: #e03e2d; font-size: 12pt;\">Для автомобилей 4 цилиндра 8 клапанов или 16 клапанов.</span></strong></em> <br><em><strong><span style=\"0color: #e03e2d; font-size: 12pt;\">Давление редуктора газа рассчитано под давление 1.0 - 1.35 бар дифференциального давления в системе ГБО</span></strong></em> <br><em><strong><span style=\"0color: #e03e2d; font-size: 12pt;\">Ход штока равен - 0.45 мм</span></strong></em></div>\r\n</div>\r\n</div>\r\n</div>','Таблица отверстий VALTEK TYPE30','Таблица отверстий для газовых форсунок гбо. Какого диаметра сверлить отверстие в форсунках ?','tablica-otverstiy-valtek-typ30'),(16,'admin','2021-08-25 12:42:20','<p>Небольшое пособие для диагностики МАП сенсора, ГБО системы.</p>\r\n<p>Эта статья написана и для новичка и для тех кто уже немного но разбирается в ГБО.</p>\r\n<p>Мап сенсор газа это деталь в которой есть несколько датчиков.</p>','<p>Эта статья написана и для новичка и для тех кто уже немного но разбирается в ГБО.</p>\r\n<p>Мап сенсор газа это деталь в которой есть несколько датчиков.</p>\r\n<p><strong>1 Датчик меряет давление газа</strong> в магистрали, подключенной от редуктора до газовых форсунок.</p>\r\n<p><strong>2 Датчик температуры газа</strong>, в некоторых системах в Мап сенсоре могли и не использовать этот датчик, делали или еще делают отдельно выносным.</p>\r\n<p><strong>3 Датчик разряжения</strong> или на простом языке датчик проверки вакуума в впускном коллекторе автомобиля.</p>\r\n<p>&nbsp;</p>\r\n<p>В современном мире стало правилом делать эту деталь газовой системы автомобиля совмещая в ней сразу несколько датчиков.</p>\r\n<p>По сути одна деталь МАП-СЕНСОР это попросту несколько <em><a id=\"\\&quot;fprsl\\&quot;\" class=\"\\&quot;gL9Hy\\&quot;\" href=\"\\&quot;https:/www.google.com/search?newwindow=1&amp;rlz=1C1CHZN_ruUA963UA963&amp;sxsrf=ALeKk03x81rtFJTifhBaMllMY3jl5WaGGQ:1629890552010&amp;q=%D0%BE%D0%B1%D1%8A%D0%B5%D0%B4%D0%B8%D0%BD%D0%B5%D0%BD%D0%BD%D1%8B%D1%85&amp;spell=1&amp;sa=X&amp;ved=2ahUKEwipuv-6h8zyAhVQhv0HHR_XD5YQkeECKAB6BAgBEDY\\&quot;\" rel=\"\\&quot;external\">объединенных</a></em> датчиков вместе.</p>\r\n<p>При неисправности любого датчика мап сенсор можно считать не рабочим.</p>\r\n<p>&nbsp;</p>\r\n<p>При поломке :</p>\r\n<p><span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;&nbsp;</span><strong>Датчик давления</strong> в мап сенсоре неисправен, тем самым система ГБО не может правильно определить величину давления и блок гбо системы воспринимает это как ошибку.</p>\r\n<p>Тем самым система не будет переходить на газ, кнопка будет издавать звук неисправности, который будет напоминать звук как будто кончился газ в баллоне.</p>\r\n<p><strong><span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;&nbsp;</span>Датчик разряжения</strong> (вакуума) в мап сенсоре неисправен, система не видит разряжение в коллекторе.</p>\r\n<p>Происходит не правильный пересчет дифференциального давления датчиком давления, так как блок гбо пересчитывает давление по показаниям датчика разряжения.</p>\r\n<p><span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;&nbsp;</span><strong>Датчик температуры газа</strong> один из важных датчиков системе газа при его поломке система гбо тоже может оповещать о том что система не исправна.</p>\r\n<p>&nbsp;</p>\r\n<p>И так приступим к самой диагностике !</p>\r\n<p>Нужно завести автомобиль и дождаться запуска системы ГБО, имеется в виду попытку переключения на газ.</p>\r\n<p>Далее запускаем программу и подключаемся к блоку.</p>\r\n<p>Нам нужно взглянуть на несколько параметров.</p>\r\n<p><strong>- Давление.</strong></p>\r\n<p><strong>- Разряжение МАР.</strong></p>\r\n<p><strong>- Температура газа.</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Рассмотрим несколько вариантов неисправности МАП сенсора:</p>\r\n<p><strong><span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;&nbsp;</span>Температура газа</strong></p>\r\n<p>Как правило этот показатель показывает некую величину равную от -10 до +85 градусов.</p>\r\n<p>Температура если это не зима 0 или + 150 градусов говорит о странном поведении датчика.</p>\r\n<p>Если показывает -30 это больше говорит о обрыве проводки в самом датчике или фишке соединения с мап сенсором.</p>\r\n<p>Стоит проверить проводку на обрыв.</p>\r\n<p>Температура +150 или около этой цифры говорит что датчик скорее всего замкнут.</p>\r\n<p>Стоит проверить проводку разъема на мап сенсоре на замыкание проводов.</p>\r\n<p><span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;&nbsp;</span>Хочу немного уточнить по поводу температур, стоит учитывать, что в разное время года и условий температуры, вы можете видеть понятное <span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;&nbsp;</span>дело разную температуру газа.</p>\r\n<p><span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;&nbsp;</span>Потому перед принятием решения, что датчик температуры в мап сенсоре неисправен стоит учитывать температуру на улице.</p>\r\n<p><span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;&nbsp;</span>Понятное дело что летом при +30 датчик температуры не может показывать температуру +20 или +10</p>\r\n<p><span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;&nbsp;</span>Думаю тут мой намёк вполне понятен.</p>\r\n<p>Так же стоит обратить внимание ещё на один нюанс.</p>\r\n<p>В программе часто встречается опция для подбора номинала датчика температуры газа и частенько номинал датчика может по каким то причинам быть выбран не тот что установлен !</p>\r\n<p>Да вы правы и такое вполне вероятно.</p>\r\n<p>Нужно выбрать именно тот номинал датчика, что стоит у вас.&nbsp;</p>\r\n<p>Номиналов много потому сказать конкретно какой стоит у вас я увы не смогу.</p>\r\n<p>Разные системы разные номиналы.</p>\r\n<p>Но есть небольшая подсказка которая облегчит выбор.</p>\r\n<p>Если Датчик температуры встроен в мап сенсор, то в поле подбора номиналов будет стоять надпись - ( в комплекте)</p>\r\n<p>Что немного вам облегчит задачу.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;&nbsp;</span>Разряжение МАР</strong>&nbsp;</p>\r\n<p>Этот показатель при заведенном автомобиле работающем на ХХ ( холостых оборотах ) чаще всего находится в пределах от 0.26 до 0.45 бар, в зависимости от самого автомобиля.</p>\r\n<p>Если резко газнуть то вы должны увидеть как цифра растёт в большую сторону вплоть до 0.99 бар, такое поведение говорит об исправной работе датчика.</p>\r\n<p>Если вы видите на ХХ цифру к примеру 0.99 это говорит, что шланг вакуумной магистрали не подключен, может быть отсоединился, а может быть с трещиной и идет подсос воздуха.</p>\r\n<p>Если с шлангом все в порядке то стоит ещё раз газнуть и понаблюдать за показаниями мап.</p>\r\n<p>Если цифра незначительно изменяется или стоит на месте ( не меняется когда вы газуете) то Датчик разряжения неисправен.</p>\r\n<p>Напоминаю, что стоит перепроверить и магистраль подключенную к мап сенсору и разъем подключения к мап сенсору.</p>\r\n<p>Показания на ХХ если более 1.0 бар и магистраль подключена РЕДУКТОР - МАП СЕНСОР - ВПУСКНОЙ КОЛЛЕКТОР, датчик неисправен.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;&nbsp;</span>Давление газа</strong></p>\r\n<p>С этим показателем тоже есть нюансы.</p>\r\n<p>Каждая система настроена по разному и разными способами и конкретной цифры нормального давления увы нет.</p>\r\n<p>Порог может быть таким - давление газа может быть от 0.9 бар до 1.70 бар, на метане может быть и до 2,5 бар.</p>\r\n<p>Как я говорил у кого как и кто как настраивает.</p>\r\n<p>Но это не самое важное, знать конкретно какое давление у вас должно быть это уже другой случай.</p>\r\n<p><span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;&nbsp;</span></p>\r\n<p><span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;&nbsp;</span>И так приступим с диагностике давления мап сенсора, проверим исправен ли этот датчик.</p>\r\n<p>Заводим автомобиль, подключаемся к блоку вашей системы и смотрим давление, что нам покажет мап сенсор.</p>\r\n<p>Сейчас не важно работает ли машина на газу или на бензине, если у вас возник вопрос.</p>\r\n<p>Понятное дело, что если не переходит на газ и кнопка в салоне сходит с ума оповещая нас об ошибке.</p>\r\n<p>Запоминаем показатель того давления, что у вас сейчас показывает в поле - ДАВЛЕНИЕ.</p>\r\n<p>Далее принудительно в салоне отключаем газ что-бы машина работала на бензине и кнопка указывала, что вы работаете именно на бензине.</p>\r\n<p><strong><span style=\"0color: #e03e2d;\">Кнопка не должна мигать в состоянии ошибки или в состоянии ожидания перехода на газ.</span></strong></p>\r\n<p>Отсоединяем шланг подачи газа от мап сенсора, на заведённом автомобиле, возможно немного газа выйдет с шланга, это не страшно, но курить в этот момент не стоит.</p>\r\n<p>Смотрим в программе на поле - ДАВЛЕНИЕ</p>\r\n<p><strong><em>При исправном</em></strong> датчике давления И ОТКЛЮЧЕННОЙ ПОДАЧЕ ГАЗА К МАП СЕНСОРУ вы должны увидеть такие цифры:</p>\r\n<p>ДАВЛЕНИЕ к примеру от 0.5 до 0.7 бар.</p>\r\n<p>РАЗРЯЖЕНИЕ МАП к примеру от 0.25 до 0.45 бар</p>\r\n<p>Далее нужно сложить вместе две величины этих показателей.</p>\r\n<p><span style=\"0color: #e03e2d;\"><strong>ДАВЛЕНИЕ + РАЗРЯЖЕНИЕ = 1 </strong></span>&nbsp;</p>\r\n<p>Пример :</p>\r\n<p>давление 0.67 бар+ разряжение мар 0.33 бар = 1 бар</p>\r\n<p>( цифра может незначительно отличаться от 1 бар. Может быть от 0.95 до 1.0 бар)</p>\r\n<p>Цифра очень близкая к 1 бар говорит, что датчик давления в мар сенсоре исправен.</p>\r\n<p><span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;&nbsp;</span></p>\r\n<p><span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;&nbsp;</span>Если же вы видите, что давление при отключенной подаче газа к мап сенсору более 0.9 бар, может быть что угодно от 0.9 до 3.0 бар</p>\r\n<p>Датчик давления в мап сенсоре неисправен.</p>\r\n<p>Так же как дополнительный метод диагностики можно опять сложить величину ДАВЛЕНИЕ+РАЗРЯЖЕНИЕ.</p>\r\n<p>Если результат превышает 1.1 то это говорит, что датчик является скорее всего <em><strong>неисправным.</strong></em></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;&nbsp;</span>Ещё один случай который не совсем относится к этой статье, но все же опишу его для общего развития.</p>\r\n<p>При заведённом автомобиле работающем на ХХ (холостые обороты) вы видите в поле ДАВЛЕНИЕ цифру 0 (ноль)</p>\r\n<p><span style=\"0color: #e03e2d;\"><strong>Шланг подачи газа не должен быть отключенным от мап сенсора, форсунок, редуктора - герметичен !</strong></span></p>\r\n<p>Это может означать некий подсос в магистрали подачи газа от редуктора к форсункам газа.</p>\r\n<p>Цифра ноль говорит о том что возможно неисправны две детали ГБО</p>\r\n<p>1 Это заклинившая или открытая форсунка газа, из за этого разряжение создаваемое в впускном коллекторе попадает в магистраль подачи и влияет на показание датчика давления, который в место положенных 0.65 показывает 0 когда газа нет в магистрали вовсе.</p>\r\n<p>Заменить или отремонтировать газовые форсунки.</p>\r\n<p>2 Это пробой вакуумной камеры в редукторе.</p>\r\n<p>Заменить или отремонтировать газовый редуктор.</p>\r\n<p>&nbsp;</p>\r\n<p>Вот в принципе и всё, возможно где то я не был точным или не полностью развернул раздел, тут уж прошу простить.</p>\r\n<p>Удачи, с вами был Сашка газовщик.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"\\&quot;mce-nbsp-wrap\\&quot;\">&nbsp;&nbsp;</span></p>','Диагностика МАП сенсора ГБО','Инструкция, пособие для диагностики МАП сенсора, ГБО системы. Эта статья написана и для новичка и для тех кто уже немного но разбирается в ГБО.','diagnostika-map-sensora-gbo'),(21,'admin','2021-08-31 23:09:26','<p><iframe src=\"https://www.youtube.com/embed/lpsytdOTcIA\" width=\"350\" height=\"196\" allowfullscreen=\"allowfullscreen\"></iframe></p>','<p>Пример вставки видео по ссылке в текст через редактор.</p>\r\n<p><iframe src=\"https://www.youtube.com/embed/lpsytdOTcIA\" width=\"350\" height=\"196\" allowfullscreen=\"allowfullscreen\"></iframe></p>','1 Stag Qbox опция - Включения цилиндров - как это работает','1 Stag Qbox опция - Включения цилиндров - как это работает','1-stag-qbox-opcija-vkljuchenija-cilindrov-kak-jeto-rabotaet'),(22,'admin','2021-08-31 23:13:13','<p><iframe style=\"width: 297px; height: 166px;\" src=\"https://www.youtube.com/embed/wQWWVtxcIy8\" width=\"297\" height=\"166\" allowfullscreen=\"allowfullscreen\"></iframe></p>','<p><iframe style=\"width: 297px; height: 166px;\" src=\"https://www.youtube.com/embed/wQWWVtxcIy8\" width=\"297\" height=\"166\" allowfullscreen=\"allowfullscreen\"></iframe></p>','2 Настройка Гбо, для коробок автомат -нюансы.','2_Настройка Гбо, для коробок автомат -нюансы.','2_nastrojka-gbo-dlja-korobok-avtomat-njuansy'),(23,'admin','2021-08-31 23:15:16','<p><iframe src=\"https://www.youtube.com/embed/yh-QE0MYnQQ\" width=\"300\" height=\"168\" allowfullscreen=\"allowfullscreen\"></iframe></p>','<p><iframe src=\"https://www.youtube.com/embed/yh-QE0MYnQQ\" width=\"300\" height=\"168\" allowfullscreen=\"allowfullscreen\"></iframe></p>','3 Фильтр ULTRA 360 LPG тоже не очень','3_Фильтр ULTRA 360 LPG тоже не очень','3_filtr-ultra-360-lpg-tozhe-ne-ochen'),(24,'admin','2021-08-31 23:17:04','<p>Короткая новость текст</p>','<p><iframe src=\"https://www.youtube.co